import React, { useState } from "react";
import { signInWithEmailAndPassword } from "firebase/auth";
import { auth } from "../utils/auth";
import { useNavigate, Link } from "react-router-dom";

export default function LoginPage() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");

    try {
      await signInWithEmailAndPassword(auth, email, password);
      navigate("/");
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ 
      background: "#000", 
      minHeight: "100vh", 
      display: "flex", 
      alignItems: "center", 
      justifyContent: "center",
      color: "#f5f6fa",
      padding: "1rem"
    }}>
      <div style={{
        background: "#1e1e1e",
        padding: "2.5rem",
        borderRadius: "12px",
        width: "100%",
        maxWidth: "400px",
        border: "1px solid #333",
        boxShadow: "0 8px 32px rgba(0,0,0,0.3)"
      }}>
        <h1 style={{ 
          textAlign: "center", 
          marginBottom: "2rem", 
          color: "#ffd966",
          fontSize: "2rem",
          fontWeight: "bold"
        }}>
          Login
        </h1>
        
        {error && (
          <div style={{
            background: "#ff4d4f",
            color: "white",
            padding: "0.8rem",
            borderRadius: "8px",
            marginBottom: "1.5rem",
            fontSize: "0.9rem"
          }}>
            {error}
          </div>
        )}

        <form onSubmit={handleLogin}>
          <div style={{ marginBottom: "1.5rem" }}>
            <label style={{ 
              display: "block", 
              marginBottom: "0.5rem",
              fontWeight: "600",
              color: "#bfc7d5"
            }}>
              Email:
            </label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              style={{
                width: "100%",
                padding: "0.8rem",
                borderRadius: "8px",
                border: "1px solid #333",
                background: "#2a2a2a",
                color: "#f5f6fa",
                fontSize: "1rem",
                boxSizing: "border-box",
                transition: "border-color 0.2s"
              }}
              onFocus={(e) => e.target.style.borderColor = "#ffd966"}
              onBlur={(e) => e.target.style.borderColor = "#333"}
            />
          </div>

          <div style={{ marginBottom: "2rem" }}>
            <label style={{ 
              display: "block", 
              marginBottom: "0.5rem",
              fontWeight: "600",
              color: "#bfc7d5"
            }}>
              Password:
            </label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              style={{
                width: "100%",
                padding: "0.8rem",
                borderRadius: "8px",
                border: "1px solid #333",
                background: "#2a2a2a",
                color: "#f5f6fa",
                fontSize: "1rem",
                boxSizing: "border-box",
                transition: "border-color 0.2s"
              }}
              onFocus={(e) => e.target.style.borderColor = "#ffd966"}
              onBlur={(e) => e.target.style.borderColor = "#333"}
            />
          </div>

          <button
            type="submit"
            disabled={loading}
            style={{
              width: "100%",
              padding: "1rem",
              background: "#ffd966",
              color: "#000",
              border: "none",
              borderRadius: "8px",
              fontWeight: "bold",
              fontSize: "1rem",
              cursor: loading ? "not-allowed" : "pointer",
              opacity: loading ? 0.7 : 1,
              transition: "background 0.2s, transform 0.1s"
            }}
            onMouseOver={e => {
              if (!loading) {
                e.currentTarget.style.background = "#ffed4e";
                e.currentTarget.style.transform = "translateY(-1px)";
              }
            }}
            onMouseOut={e => {
              if (!loading) {
                e.currentTarget.style.background = "#ffd966";
                e.currentTarget.style.transform = "translateY(0)";
              }
            }}
          >
            {loading ? "Logging in..." : "Login"}
          </button>
        </form>

        <p style={{ 
          textAlign: "center", 
          marginTop: "1.5rem",
          fontSize: "0.9rem"
        }}>
          Don't have an account?{" "}
          <Link to="/signup" style={{ 
            color: "#ffd966",
            textDecoration: "none",
            fontWeight: "600"
          }}>
            Sign up
          </Link>
        </p>
      </div>
    </div>
  );
}
